import { Component } from "react";
import Button from "react-bootstrap/Button";
import { Link } from "react-router-dom";

interface IProps {}

class Main extends Component<IProps> {
  render() {
    return (
      <body>
        <Link to="/">
          <button>뒤로</button>
        </Link>
      </body>
    );
  }
}

export default Main;
